import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Register } from '../models/register.model';

@Injectable({
  providedIn: 'root'
})
export class RegisterService {

    baseUrl: string = "http://localhost:4200/registration";

    constructor(private httpclient: HttpClient) { }

    getRegister() : Observable<Register[]>{
      return this.httpclient.get<Register[]>(this.baseUrl);
    }
  
    saveRegister(register: Register): Observable<Register>{
      return this.httpclient.post<Register>(this.baseUrl + '/store', register);
    }

}
